import React, { Component } from 'react';
import './contactMe.css';
import ContactMeInput from './contactMeInput/contactMeInput';

class ContactMe extends Component {
    state = { 
        contactMe: { 
            name: {
                elementType: 'input',
                elementConfig: {
                    type: "text",
                    placeholder: "Your Name:"
                },
                value: '',
            },
            email:  {
                elementType: 'input',
                elementConfig: {
                    type: "text",
                    placeholder: "Your E-mail:"
                },
                value: '',
            },
            subject:  {
                elementType: 'input',
                elementConfig: {
                    type: "text",
                    placeholder: "The Subject:"
                },
                value: '',
            },
            message:  {
                elementType: 'textarea',
                elementConfig: {
                    type: "text",
                    placeholder: "Your Message:"
                },
                value: '',
            },
        }
     }


    render() { 
        return ( 
            <div className="contactMe">
            <div className="contactMeHeader"><div className="blueDot" style={{marginTop: 12}} /><h1>Let's talk</h1></div>
                <div className="contactMeForm">
                    <form style={{width: '100%'}}>

                        <ContactMeInput elementType="" elementConfig="" value="" />

                        <ContactMeInput inputtype="input" type="text" name="name" placeholder="Your Name" />
                        <ContactMeInput inputtype="input" type="email" name="email" placeholder="Your Email" />
                        <ContactMeInput inputtype="input" type="subject" name="subject" placeholder="The Subject" />
                        <ContactMeInput inputtype="textarea" type="message" name="message" placeholder="Your Message" />
                        <button className={'btn1'}>SEND</button>
                        <button className={'btn2'}>CLEAR</button>
                    </form>
                </div>
            </div> 
         );
    }
}

export default ContactMe;
